import React, { useState } from 'react';


const Payment = () => {
  const [paymentOption, setPaymentOption] = useState(null);
  const [cardDetails, setCardDetails] = useState({
    cardNumber: '',
    expiryDate: '',
    cvv: ''
  });

  const handlePaymentOptionChange = (option) => {
    setPaymentOption(option);
  };

  const handleCardDetailsChange = (e) => {
    const { name, value } = e.target;
    setCardDetails({
      ...cardDetails,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // You can integrate actual payment gateway API here (e.g., Stripe, PayPal)
    alert(`Payment via ${paymentOption} processed!`);
  };

  return (
    <div className="payment-container">
      <h2>Select a Payment Method</h2>
      
      <div className="payment-options">
        <button onClick={() => handlePaymentOptionChange('QR Code')}>QR Code</button>
        <button onClick={() => handlePaymentOptionChange('Debit Card')}>Debit Card</button>
      </div>

      {paymentOption === 'QR Code' && (
        <div className="qr-code">
          <h3>Scan the QR Code to Pay</h3>
          {/* Generating the QR code */}
          <div className="qr-code-container">
            <QRCode value="https://paymentgateway.com/qr-code" size={256} />
            {/* Overlaying your custom image */}
            <img 
              className="qr-img-overlay" 
              src="your-image-url-here.jpg" 
              alt="custom logo" 
            />
          </div>
          <p>Or use this link: https://paymentgateway.com/qr-code</p>
        </div>
      )}

      {paymentOption === 'Debit Card' && (
        <div className="debit-card-form">
          <h3>Enter Your Debit Card Details</h3>
          <form onSubmit={handleSubmit}>
            <div className="input-group">
              <label>Card Number</label>
              <input 
                type="text" 
                name="cardNumber" 
                value={cardDetails.cardNumber} 
                onChange={handleCardDetailsChange} 
                placeholder="1234 5678 9876 5432"
                required 
              />
            </div>
            <div className="input-group">
              <label>Expiry Date</label>
              <input 
                type="text" 
                name="expiryDate" 
                value={cardDetails.expiryDate} 
                onChange={handleCardDetailsChange} 
                placeholder="MM/YY" 
                required 
              />
            </div>
            <div className="input-group">
              <label>CVV</label>
              <input 
                type="text" 
                name="cvv" 
                value={cardDetails.cvv} 
                onChange={handleCardDetailsChange} 
                placeholder="123"
                required 
              />
            </div>
            <button type="submit">Pay Now</button>
          </form>
        </div>
      )}
      
      {/* CSS Styles */}
      <style jsx>{`
        .payment-container {
          width: 100%;
          max-width: 500px;
          margin: auto;
          padding: 20px;
          border: 1px solid #ccc;
          border-radius: 10px;
          background-color: #f9f9f9;
        }

        .payment-options button {
          margin: 10px;
          padding: 10px 20px;
          cursor: pointer;
          font-size: 16px;
          background-color: #4CAF50;
          color: white;
          border: none;
          border-radius: 5px;
        }

        .payment-options button:hover {
          background-color: #45a049;
        }

        .qr-code {
          text-align: center;
        }

        .qr-code-container {
          position: relative;
          display: inline-block;
        }

        .qr-img-overlay {
          position: absolute;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
          width: 50px; /* Adjust size as needed */
          height: 50px; /* Adjust size as needed */
        }

        .debit-card-form {
          margin-top: 20px;
        }

        .debit-card-form .input-group {
          margin-bottom: 15px;
        }

        .debit-card-form input {
          width: 100%;
          padding: 10px;
          margin-top: 5px;
          border: 1px solid #ccc;
          border-radius: 5px;
        }

        .debit-card-form button {
          width: 100%;
          padding: 10px;
          background-color: #4CAF50;
          color: white;
          border: none;
          border-radius: 5px;
          font-size: 16px;
        }

        .debit-card-form button:hover {
          background-color: #45a049;
        }
      `}</style>
    </div>
  );
};

export default Payment;
